export const fetchQuizQuestions = (kanjiLevel:number,numberOfQuestions:number) => {

  useEffect(()=>{
    const fetchQuestions = async () => {
      try{
        // const result = await axios.get(`http://localhost:8082/api/kanji/kanjiquestions/${kanjiLevel}/${numberOfQuestions}`)
        const result = await axios.get(`http://localhost:8082/api/kanji/kanjiquestions/4/5`)

        const data = await result.data
        return data
      }
      catch{
        return []
      }
    }

    fetchQuestions().then((res)=>{
      setQuizQuestions(res)
    })
  },[])

  axios({
    method: "get",
    url: `http://localhost:8082/api/kanji/kanjiquestions/${kanjiLevel}/${numberOfQuestions}`
  }).then((res)=>res)


}
